import React from "react";
import "./styles/summary.css";

const Summary = ({ recentTrades }) => {
  const totalWin = recentTrades.reduce(
    (total, trade) => total + (parseFloat(trade.profit_loss) > 0 ? 1 : 0),
    0
  );
  // Total loss
  const totalLoss = recentTrades.reduce(
    (total, trade) => total + (parseFloat(trade.profit_loss) < 0 ? 1 : 0),
    0
  );
  // Net profit/loss
  const netProfitLoss = recentTrades.reduce(
    (total, trade) => total + parseFloat(trade.profit_loss),
    0
  );
  // Win rate
  const winRate = (totalWin / recentTrades.length) * 100;

  const winTrades = recentTrades.filter(
    (trade) => parseFloat(trade.profit_loss) > 0
  );
  const lossTrades = recentTrades.filter(
    (trade) => parseFloat(trade.profit_loss) < 0
  );
  // Average win
  const avgWin =
    winTrades.length > 0
      ? winTrades.reduce(
          (total, trade) => total + parseFloat(trade.profit_loss),
          0
        ) / winTrades.length
      : 0;
  // Average loss
  const avgLoss =
    lossTrades.length > 0
      ? lossTrades.reduce(
          (total, trade) => total + parseFloat(trade.profit_loss),
          0
        ) / lossTrades.length
      : 0;

  const totalInvestment = recentTrades.reduce(
    (total, trade) =>
      total + parseFloat(trade.entry_price) * parseFloat(trade.contracts),
    0
  );
  // Return on investment (ROI)
  const roi = (netProfitLoss / totalInvestment) * 100;

  // Win/loss ratio
  const winLossRatio = Math.abs(avgWin / avgLoss);

  return (
    <div className="summary-container">
      <div className="summary">
        <div className="header-card">
          <p>Summary</p>
        </div>
        <div className="details-cards">
          {/* P&L / RoI */}
          <div className="plroi">
            <div className="left">
              <p className="title">P&L: ${netProfitLoss.toFixed(2)}</p>
            </div>
            <div className="right">
              <p className="title">RoI: {roi.toFixed(2)}%</p>
            </div>
          </div>
          {/* Wins / Loss */}
          <div className="winloss">
            <div className="left">
              <p className="title">Total Win:</p>
              <p className="title-details">{totalWin}</p>
            </div>
            <div className="right">
              <p className="title">Total Loss:</p>
              <p className="title-details">{totalLoss}</p>
            </div>
          </div>{" "}
          {/* Avg Win / Avg Loss */}
          <div className="winloss">
            <div className="left">
              <p className="title">Avg. win:</p>
              <p className="title-details">${avgWin.toFixed(2)}</p>
            </div>
            <div className="right">
              <p className="title">Avg. loss:</p>
              <p className="title-details">${avgLoss.toFixed(2)}</p>
            </div>
          </div>
          {/* Win rate / W&L ratio */}
          <div className="rate-ratio">
            <div className="win-rate">
              <p className="title">Win rate:</p>
              <p className="title-details">{winRate.toFixed(2)}%</p>
            </div>
            <div className="ratio">
              <p className="title">W/L ratio:</p>
              <p className="title-details">{winLossRatio.toFixed(2)}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Summary;
